Map {
User Stories {
Display Unsupported Orders: As a user, I want to be able to view all unsupported orders in the climbing application.
Select Travel Time: As a user, I want to be able to select a travel time for my climbing trip.
View Climbing Routes: As a user, I want to be able to view all available climbing routes in the application.
Book Climbing Trip: As a user, I want to be able to book a climbing trip in the application.
View Climbing Gear: As a user, I want to be able to view all available climbing gear in the application.
Purchase Climbing Gear: As a user, I want to be able to purchase climbing gear in the application.
View Climbing Tips: As a user, I want to be able to view all available climbing tips in the application.
}

Administrative Tasks {
Manage Unsupported Orders: As an administrator, I want to be able to manage unsupported orders in the climbing application.
Manage Climbing Routes: As an administrator, I want to be able to manage all available climbing routes in the application.
Manage Climbing Gear: As an administrator, I want to be able to manage all available climbing gear in the application.
Manage Climbing Tips: As an administrator, I want to be able to manage all available climbing tips in the application.
}
}
